import React, { Component } from "react";

class Button extends Component {
  render() {
    const { text, liked, onLikeClick, id } = this.props;

    return (
      <button onClick={() => onClick(id)} class={liked ? "liked" : "not-liked"}>
        {text}
      </button>
    );
  }
}

export default Button;
